import { ItemT } from '../../types/ItemT';
import { v4 as uuidv4 } from 'uuid';

export const generateRandomData = (count: number): ItemT[] => {
  const result = [] as ItemT[];
  for (let i = 0; i < count; i++) {
    result.push({
      id: uuidv4().toLowerCase(),
      title: `${randomTitle()}  ${i}`,
      description: generateDescription(i),
      rating: randomRating(),
      moviePosterUrl: generateImageUrl(),
    });
  }
  return result;
};

export const randomTitle = (): string => {
  const rand1 = Math.floor(Math.random() * 10);
  const titles = [
    'Superman',
    'Some very very very long long long title',
    'Mission impossible',
    'Dog&friends',
    'No planet B',
    'Grimm',
    'Merry Christmas',
    'Gump',
    'Batman and Robin',
    'The Circle',
  ];
  return titles[rand1];
};
export const randomRating = (): number => {
  return Math.floor(Math.random() * 5) + 1;
};

export const generateDescription = (index: number): string => {
  const modulo = index % 3;
  switch (modulo) {
    case 0:
      return 'lorem impsum dolor it saamet';
    case 1:
      return 'some very very very long long long description';
    case 2:
      return 'lorem impsum dolor it saamet';
    default:
      throw new Error('unknown modulo' + modulo);
  }
};

export const generateImageUrl = (): string => {
  const rand = Math.floor(Math.random() * 8);
  switch (rand) {
    case 0:
      return 'data:image/jpeg;base64,';
    case 1:
      return 'data:image/jpeg;base64,';
    case 2:
      return 'data:image/jpeg;base64,';
    case 3:
      return 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcS0Aonb4yTMV4nFGG07G9LhhCTtDXiswUiQ_A&usqp=CAU';
       case 4:
      return 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcR185doH7-F0Lt6vvH35KAvay6ml8HXMBvNRQ&usqp=CAU';
    case 5:
      return 'data:image/jpeg;base64,';
    case 6:
      return 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQwlJd764mtWhMJHiaLyW3vHuALfIXl7cuYfQ&usqp=CAU';
       case 7:
      return 'data:image/jpeg;base64,';
    default:
      throw new Error('unknown rand' + rand);
  }
};
